import "./Button.css";
import arrow from "./arrowright.svg";

const hola = () => {
	console.log("Independent callback");
};
function Button({ isotipo = false, texto = "Mensaje no seteado" } = {}) {
	return (
		<button className="Buttonjs" type="button" onClick={hola}>
			<p>{texto}</p>
			{ isotipo ? <img src={arrow} alt="generar" /> : null }
		</button>
	);
}
export default Button;
